import React from 'react'

import './home.css'
import {Icon} from "@iconify/react/dist/iconify";
import locationIcon from "@iconify/icons-mdi/map-marker";
import GoogleMapReact from "google-map-react";
import MapPopup from "../dialog/LocationDialog";
import LocationDialog from "../dialog/LocationDialog";
import Footer from "../footer/Footer";
import Offcanvas from 'react';
import Button from 'react';
import useState from 'react';
import render from 'react';
import Polyline from 'react';
import WidthAndHeight from "../Resp/Respo"
import { Map, GoogleApiWrapper, onMapClicked } from "google-maps-react";
export class MapContainer extends Component {
  render() {
    style = {
      width: "100%",
      height: "100%"
    };
    onMapClicked = () => {
      // handle on click events
    };
    return (
      <Map
        google={this.props.google}
        style={this.style}
        initialCenter={{
          lat: 40.854885,
          lng: -88.081807
        }}
        zoom={15}
        onClick={this.onMapClicked}
      ></Map>
    );
  }
}
export default GoogleApiWrapper({
  apiKey: AIzaSyAE0KWR1OPQnOJTT5_5itfg6O5LABsuTZ8
})(MapContainer);
